import React from 'react';
import Modal from '../Modal';
import history from '../../history';

class Art extends React.Component{
  render(){
    return(
      <Modal
          title="Art "
          content= ""
          onDismiss={() => history.push('/aboutus')}
      />
    );
  }
}

export default Art;
